import React from 'react';

class Footer extends React.Component {
  render() {
    return (
      <div className='footer'>
        <div className='footer-inner'>
          <div className='footer-logo'>
            <a href="https://github.com/HirokiNishimoto/calender">
            <img src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAOEAAADhCAMAAAAJbSJIAAAAkFBMVEX///8XFRYAAAD+/v4VExQZFx" alt="画像タイトルや代替えテキスト"/>
            </a>

            <p>Learn to code, learn to creative.</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Footer;
